bool freq[20000] = {0};

int maxCount(vector<int> &banned, int n, int maxSum)
{

    for (int i = 0; i <= banned.size() - 1; i++)
    {
        freq[banned[i]] = true;
    }

    // for(int i = 0 ; i < 10 ; i++){
    //     cout << "ans " << freq[i] << endl;
    // }

    int sum = 0;
    int count = 0;
    for (int i = 1; i <= n; i++)
    {
        if (freq[i] == true)
            continue;

        sum += i;

        if (sum > maxSum)
            continue;

        count++;
    }
    return count;
}

